('0061124958', 23, 'This book is stunning, really makes you think how degraded our government has become.', 2),
('0061124958', 231, ' find this work still is applicable if not even more so now than when it was written.', 1),
('0061124958', 452, 'I loved this book. However, at the conclusion of the book, wanted to know more about the man he is now and the journey he took after he arrived in the US.', 5),
('0061124958', 541, 'I truthfully had no idea what to expect when picking up Bel Canto. The title was a bit intimidating and I was afraid it was going to be some fluffy classic piece of work. However, Bel Canto is nothing like I expected.', 4),
('0061124958', 680, 'Ill apologize in advance for the rambling nature of this review, I cant seem to collect my thoughts around this book. Its fine, just fine. Im no opera aficionado, maybe thats why I found the first half cumbersome and tiring.', 5),
('0061146307', 72, 'I truthfully had no idea what to expect when picking up Bel Canto. The title was a bit intimidating and I was afraid it was going to be some fluffy classic piece of work. However, Bel Canto is nothing like I expected.', 3),
('0061565318', 184, ' find this work still is applicable if not even more so now than when it was written.', 5),
('0061565318', 470, 'I read this in high school (Im 72 now) and at that time it was a prediction of things to come. In some ways its pretty close. It is interesting that people are reading it more now because of the current situation. I think that if they are alarmed by this book they should try It Cant Happen Here.\r\n', 5),
