('0061565318', 981, 'This book is stunning, really makes you think how degraded our government has become.', 3),
('0307389731', 368, 'Frankly Im unqualified to rate this. Thus, it gets a 5 star to avoid doing it a disservice. While considering myself fairly intelligent, it''s evident Im not in this league. Having read and understood all of the words in this book, I just do not have a firm grasp on much of what Mr. Hawking presents. The concepts, proofs and theries are beyond my ability to comprehend. He makes a great attempt to reach the non-scientist reader. A really good job; a terrific effort. But this reader wasnt up to the task.', 2),
('0374531269', 69, ' find this work still is applicable if not even more so now than when it was written.', 4),
